import React, { Component } from 'react';
import { Link } from "react-router-dom";

class NavBar extends Component {
    state = {  }
    render() { 
        return (<div className="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-white border-bottom shadow-sm">
        <h5 className="my-0 mr-md-auto font-weight-normal"> {this.props.title}</h5>
        <nav className="my-2 my-md-0 mr-md-3">
          <Link className="p-2 text-dark" to="/nike">Nike</Link>
          <Link className="p-2 text-dark" to="strava">Strava</Link>
        </nav>
        <Link className="btn btn-outline-primary" to="/" role="button">Home</Link>
      </div>);
    }
}
 
export default NavBar;
